! function($) {
    $(function() {
        $(".tblCheckbox").each(function() {
            $(this).change(function() {
                $(this).is(":checked") ? swal({
                    title: "Are you sure?",
                    text: "You will want to acive",
                    type: "warning",
                    showCancelButton: !0,
                    confirmButtonClass: "btn-danger",
                    confirmButtonText: "Yes, active it!",
                    cancelButtonText: "No, cancel please!",
                    closeOnConfirm: !1,
                    closeOnCancel: !1
                }, function(e) {
                    e ? swal("Activeted!", "success") : swal("Cancelled", "Your accouunt requeat is not acepated", "error")
                }) : swal({
                    title: "Ajax request example",
                    text: "Submit to run ajax request",
                    type: "info",
                    showCancelButton: !0,
                    closeOnConfirm: !1,
                    showLoaderOnConfirm: !0
                }, function() {
                    setTimeout(function() {
                        swal("Ajax request finished!")
                    }, 2e3)
                })
            })
        }), $("#reviewsFrm").validate({
            onfocusout: !1,
            onkeyup: !1,
            validClass: " ",
            errorElement: "div",
            errorClass: "errMsg",
            errorContainer: "#reviewError",
            errorPlacement: function(e, r) {
                e.appendTo("#reviewError")
            },
            ignore: ":hidden",
            rules: {
                rev_book_no: {
                    required: !0
                },
                rev_pincode: {
                    required: !0
                },
                rev_tittle: {
                    required: !0
                },
                val_rev_rating: {
                    required: !0,
                    notEquals: "Overall Rating"
                },
                rev_description: {
                    required: !0,
                    minlength: 50
                }
            },
            messages: {
                rev_book_no: {
                    required: "Please enter your booking number"
                },
                rev_pincode: {
                    required: "Please enter your pin code"
                },
                rev_tittle: {
                    required: "Please enter Your subject tittle"
                },
                rev_rating: {
                    required: "Please select your rating",
                    notEquals: "Please select your rating"
                },
                rev_description: {
                    required: "Please enter description",
                    minlength: "Description should be 50 character"
                }
            },
            invalidHandler: function(e, r) {
                $("#reviewError").slideDown()
            },
            submitHandler: function(e) {
                return !1
            }
        }), $("#addFormvalidate").validate({
            onfocusout: !1,
            onkeyup: !1,
            validClass: " ",
            errorElement: "div",
            errorClass: "errMsg",
            errorContainer: "#tabUmarahError",
            errorPlacement: function(e, r) {
                e.appendTo("#tabUmarahError")
            },
            ignore: ":hidden",
            rules: {
                val_type_upackage: {
                    required: !0,
                    notEquals: "Select Umrah Package"
                },
                type_serch_date: {
                    required: !0
                },
                type_roomtype: {
                    required: !0
                },
                type_uadults: {
                    required: !0,
                    notEquals: "0"
                },
                type_uchildren: {
                    required: !0,
                    notEquals: "Overall Rating"
                }
            },
            messages: {
                val_type_upackage: {
                    required: "Please enter your booking number",
                    notEquals: "Please Select Package"
                },
                type_serch_date: {
                    required: "Please enter Departure date"
                },
                type_roomtype: {
                    required: "Please enter room type"
                },
                type_uadults: {
                    required: "Please enter how much person"
                },
                type_uchildren: {
                    required: "Please enter how much children",
                    notEquals: "Please select your rating"
                }
            },
            invalidHandler: function(e, r) {
                $("#tabUmarahError").slideDown()
            },
            submitHandler: function(e) {
                return !1
            }
        })
    })
}(jQuery);